import React from 'react'
import {Routes, Router, Route} from 'react-router-dom'

function QuoteApp() {
  return (
    <div>
        <Routes>
        <Route path={'/'} element={<div>All quotes</div>} />
        <Route path={'/quote/:id'} element={<div>Home</div>} />
        </Routes>
    </div>
  )
}

export default QuoteApp
